import React from 'react';
import  './BtnComponent.css';

const BtnComponent = ({status,stop,reset,resume,start}) => {
  return (
    <div>
      
        <button className="stopwatch-btn " onClick={start}>Start</button> 
        <button className="stopwatch-btn " onClick={stop}>Wait</button>
        <button className="stopwatch-btn " onClick={resume}>Resume</button>
        <button className="stopwatch-btn " onClick={reset}>Reset</button>
         
      
     
    </div>
  );
}

export default BtnComponent;
